import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  AvatarWoman,
  AvatarMan,
  SettingTwoIcon,
  SettingThreeIcon,
  ArrowDown,
  ArrowUp,
} from "../common/icons/icons.jsx";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

const TableEmployee = () => {
  const [user, setUsers] = useState([]);
  const [openedRows, setOpenedRows] = useState([]);

  useEffect(() => {
    getUsers();
  }, []);

  const getUsers = async () => {
    const response = await axios.get("http://localhost:5000/users");
    setUsers(response.data);
  };

  const deleteUser = async (userId) => {
    await axios.delete(`http://localhost:5000/users/${userId}`);
    getUsers();
  };

  const handleRowClick = (index) => {
    if (openedRows.includes(index)) {
      setOpenedRows(openedRows.filter((i) => i !== index));
    } else {
      setOpenedRows([...openedRows, index]);
    }
  };

  return (
    <div>
      <div className="div-table">
        <table className="employee-table">
          <thead>
            <tr className="employee-tr">
              <th>Imie Nazwisko</th>
              <th>Stanowisko</th>
              <th>Oddział</th>
              <th>Email</th>
              <th>Doświadczenie</th>
              <th className="employee-setting">Opcje</th>
            </tr>
          </thead>
          <tbody>
            {user.map((user, index) => (
              <React.Fragment key={user.uuid}>
                <tr
                  key={user.uuid}
                  className="employee-tr"
                  onClick={() => handleRowClick(index)}
                >
                  {/* <td className="td-employee"> {index + 1} </td> */}
                  <td className="employee-profile td-employee">
                    {user.sex == "Kobieta" ? (
                      <div className="circle-avatar-women">
                        {user &&
                          `${user.name.charAt(0).toUpperCase()}${user.surname
                            .charAt(0)
                            .toUpperCase()}`}
                      </div>
                    ) : (
                      <div className="circle-avatar-man">
                      {user &&
                        `${user.name.charAt(0).toUpperCase()}${user.surname
                          .charAt(0)
                          .toUpperCase()}`}
                    </div>
                  )}
                            <button className="button-table" onClick={() => handleRowClick(index)}>
                            {selectedRow === index ? <ArrowDown className="employee-icon" /> : <ArrowUp className="employee-icon" />}
                          </button>
                          <button className="button-table" onClick={() => handleRowClick(index+1)}>
                            {selectedRow === index+1 ? <ArrowDown className="employee-icon" /> : <ArrowUp className="employee-icon" />}
                          </button>
                        </td>
                      </tr>
                      {selectedRow === index && (
                        <tr className="employee-tr-info">
                          <td colSpan="6">
                            <div className="employee-info">
                              <div>Adres: {user.address}</div>
                              <div>Telefon: {user.phone}</div>
                              <div>Data zatrudnienia: {user.employmentDate}</div>
                            </div>
                            <div className="employee-options">
                              <Link
                                to={`/users/edit/${user.uuid}`}
                                className="button is-small is-info"
                              >
                                Edit
                              </Link>
                              <button
                                onClick={() => deleteUser(user.uuid)}
                                className="button is-small is-danger"
                              >
                                Delete
                              </button>
                            </div>
                          </td>
                        </tr>
                      )}
                      {selectedRow === index+1 && (
                        <tr className="employee-tr-info">
                          <td colSpan="6">
                            <div className="employee-info">
                              <div>Adres: {user.address}</div>
                              <div>Telefon: {user.phone}</div>
                              <div>Data zatrudnienia: {user.employmentDate}</div>
                            </div>
                            <div className="employee-options">
                              <Link
                                to={`/users/edit/${user.uuid}`}
                                className="button is-small is-info"
                              >
                                Edit
                              </Link>
                              <button
                                onClick={() => deleteUser(user.uuid)}
                                className="button is-small is-danger"
                              >
                                Delete
                              </button>
                            </div>
                          </td>
                        </tr>
                      )}
                    </React.Fragment>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
          );
        };
        
        export default TableEmployee;
